import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
      <NavLink to="/">
        <div>
          <img />
        </div>
      </NavLink>
      </div>
      <div>
        <NavLink>
        <p>Home</p>
        <FaShoppingCart/>
        </NavLink>
      </div>
    </div>
  );
};

export default Navbar;
